INSERT INTO `job` (`jobid`,`employerid`,`jobcategory`,`employeetype`,`city`,`countryid`,`jobtitle`,`summary`,`description`,`requirements`,`dateposted`,`dateclosing`,`contactinfo`,`pay`,`alias`,`levelid`) VALUES 
 (1,1,211,'Full-Time','Buenos Aires',1,'Secretaria','Un tester para repartir tarjetas','<p>\r\n	Buscamos un tester para repartir tarjetas y ver si la gente las acepta o las tira por la cabeza.</p>\r\n','<p>\r\n	Requerimos cara de piedra,&nbsp;y mucho tiempo libre.</p>\r\n','2011-05-01','2011-05-31','<p>\r\n	Comunicarse&nbsp;de 9 a 13 horas al <strong>5555-6666 </strong>con el Sr. Gazulo.</p>\r\n<p>\r\n	Mandar foto por mail a <a href=\"mailto:gazulo@correomail.com.br\">gazulo@correomail.com.br</a></p>\r\n','1000','Importante Empresa Petrolera',1),
 (2,1,207,'Full-Time','Miami Beach',300,'Manager','manager para importante empresa','<p>\r\n	se requiere mucha paciencia</p>\r\n','<p>\r\n	gerente loco para mi empresa</p>\r\n','2011-05-06','2011-05-31',NULL,NULL,NULL,6),
 (4,1,210,'Full-Time','Salto, Pcia. de Buenos Aires',1,'Supervisor de Producci&oacute;n','Supervisor de Producci&oacute;n, Planta Salto, Pcia. de Buenos Aires','<p>\r\n	El puesto exige cubrir el turno diurno, para el control de producci&oacute;n de la planta de fabricaci&oacute;n.</p>\r\n','<p>\r\n	Profesionales j&oacute;venes en Ing. Mec&aacute;nica, Industrial, Qu&iacute;mica o en Alimentos. Experiencia en &aacute;reas de Producci&oacute;n y/o Ingenier&iacute;a de Procesos. Habilidades de liderazgo, afirmaci&oacute;n personal y toma de decisiones. Relocalizaci&oacute;n en Salto, Pcia. de Buenos Aires (excluyente). Disposici&oacute;n para trabajar en turnos rotativos. Se ofrecen reales posibilidades de desarrollo en una empresa con tecnolog&iacute;a de avanzada.</p>\r\n','2011-05-22','2011-06-20',NULL,NULL,'BAGLEY',5),
 (7,1,209,'Full-Time','Buenos Aires',1,'Promotoras','Promotoras para publicitar libros de escuela primaria y secundaria','<p>\r\n	<span style=\"font-family: \'Arial\', \'sans-serif\'; color: #222222; font-size: 9pt\">Para promocionar las nuevas ediciones de libros de lectura y texto para escuelas primarias y secundarias, se requieren Promotoras, para cubrir las &agrave;reas de CABA y GBA Norte.</span></p>\r\n<p>\r\n	<span style=\"font-family: \'Arial\', \'sans-serif\'; color: #222222; font-size: 9pt\"><span style=\"font-family: \'Arial\', \'sans-serif\'; color: #222222; font-size: 9pt\">Se ofrece muy buena remuneraci&ograve;n m&agrave;s vi&aacute;ticos, relaci&oacute;n de dependencia y posibilidad de crecimiento<o:p></o:p></span></span></p>\r\n<p>\r\n	<span style=\"font-family: \'Arial\', \'sans-serif\'; color: #222222; font-size: 9pt\"><o:p></o:p></span></p>\r\n<p>\r\n	&nbsp;</p>\r\n','<p>\r\n	- Estudios secundarios completos (excluyente).</p>\r\n<p>\r\n	- Edad entre 25 y 40 a&ntilde;os.</p>\r\n<p>\r\n	- Movilidad propia en perfecto estado (excluyente).</p>\r\n<p>\r\n	- Disponibilidad full time.</p>\r\n','2011-05-23','2011-06-20',NULL,NULL,'Importante Editorial',3);
